import React from 'react';
import { connect } from 'react-redux';
import Event from '../components/Event';

const styles = {
  position: "absolute",
  right: 0,
  width: 100,
  paddingRight: 0
}

function EventList({ events }) {
  console.log("hey");
  console.log(events);

  if(!events.items) {
    return (
      <div>
        No Events
      </div>
    )
  }
  return (
      <div className="container" style={styles}>
        <div className="row">
          <div className="col-xs-6">
          <div id='events-panel' className="panel panel-primary">
            <div className="panel-heading">
              <h3 className="panel-title">Events</h3>
            </div>
            <div className="panel-body">
              <div id="events" className="list-group">
                {(events.items).map(show => {
                  return (
                    <Event event={ show } />
                  );
                })}
              </div>
            </div>
            <div className="panel-footer">
              <nav>
                <ul className="pager">
                  <li id="prev" className="previous"><a href="#"><span aria-hidden="true">&larr;</span></a></li>
                  <li id="next" className="next"><a href="#"><span aria-hidden="true">&rarr;</span></a></li>
                </ul>
              </nav>
            </div>
          </div>

          <div id='attraction-panel' className="panel panel-primary">
            <div className="panel-heading">
              <h3 className="panel-title">Attraction</h3>
            </div>
            <div id="attraction" className="panel-body">
              <h4 className="list-group-item-heading">Attraction title</h4>
              <img className="col-xs-12" src="" />
              <p id="classification"></p>
            </div>
          </div>
          </div>
        </div>
      </div>
  );
}

const mapStateToProps = state => {
  return {
    events: state.events
  };
};

const mapDispatchToProps = dispatch => {
  return {

  };
};

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(EventList);
